import React from "react";
import { Link } from 'react-router-dom';
import "./styles.css";

export default function Landing() {
  return (
    <div className="App">
      <header><h1>Milliwonkim</h1></header>
      <nav>
        <li><Link to="/portfolio">Portfolio</Link></li>
        <li><Link to="/youtube">YouTube</Link></li>
        <li><Link to="frontend">Frontend Development</Link></li>
        <li><Link to="android">Android</Link></li>
        <li><Link to="ios">iOS</Link></li>
        <li><Link to="contact">Contact</Link></li>
      </nav>
      <section>

      </section>
      <footer>
        <h5>Contact: 8210-3355-9347</h5>
        <h5>Email: milliwonkim@gmail.com</h5>
      </footer>
    </div>
  );
}
